import { useNavigate } from "react-router-dom";

export default function GridItem({ produto }) {
    const navigate = useNavigate();

    const movimentar = () => {
        navigate(`/MovimentarProduto/${produto.id}`);
    };

    return (
        <div className="card bg-dark text-light p-3 mb-3 shadow-lg">
            <div className="card-body">
                <h5 className="card-title fw-bold">{produto.nome}</h5>
                <p className="card-text">
                    <strong>Código EAN:</strong> {produto.id} <br />
                    <strong>Preço:</strong> R$ {produto.preco} <br />
                    <strong>Categoria:</strong> {produto.categoria} <br />
                    <strong>Quantidade:</strong> {produto.quantidade}
                </p>
                <button className="btn btn-primary w-100" onClick={movimentar}>
                    Movimentar
                </button>
            </div>
        </div>
    );
}
